def substringCalculator(s):
    substrings = dict()
    for start_index in range(0, len(s)):
        sub_selection = s[start_index:]
        for end_index in range(len(sub_selection), 0, -1):
            sub = sub_selection[0:end_index]
            if substrings.get(sub, False) is False:
                substrings[sub] = True

    return len(substrings)


print(substringCalculator('abcde'))
print(substringCalculator('kincenvizh'))
print(substringCalculator('banana'))
print(substringCalculator(''))
